// CronServiceServer is the server API for CronService service.
type CronServiceServer interface {
	//地市医保局获取配送企业信息
	CronWsGetCompany(context.Context, *OperateIntReq) (*OperateIntResp, error)
	//地市医保局获取生产企业信息
	CronWsGetCompanySC(context.Context, *CreateTpSyncComInfoReq) (*CreateTpSyncInfoResp, error)
	//地市医保局获取合同信息
	CronWsGetContract(context.Context, *OperateStrDateReq) (*OperateIntResp, error)
	//地市医保局获取药品目录信息
	CronWsGetGoods(context.Context, *OperateIntReq) (*OperateIntResp, error)
	//地市医保局获取所属医院信息
	CronWsGetHospital(context.Context, *OperateIntReq) (*OperateIntResp, error)
	//地市医保局获取配送计划信息
	CronWsGetPlan(context.Context, *OperateStrDateReq) (*OperateIntResp, error)
	//省订单同步
	SyncPShipmentPlan(context.Context, *CreateSyncShipmentPlanReq) (*CreateTpSyncInfoResp, error)
	//联行号下载
	CronBankSyncCNAPS(context.Context, *OperateIntReq) (*OperateIntResp, error)
	//银行付款结果查询
	CronBankSyncBankPayment(context.Context, *OperateIntReq) (*OperateIntResp, error)
	//医疗机构自动支付
	CronBankMiAutoPay(context.Context, *OperateIntReq) (*OperateIntResp, error)
	//保理自动还款
	CronBankAutoFactoringRepay(context.Context, *OperateIntReq) (*OperateIntResp, error)
	//银行回单下载
	CronBankSyncReceipt(context.Context, *OperateStrDateReq) (*OperateIntResp, error)
	//银行保理结果查询
	CronBankSyncFactoring(context.Context, *OperateIntReq) (*OperateIntResp, error)
	//银行保理还款查询
	CronBankSyncFactoringRepay(context.Context, *OperateIntReq) (*OperateIntResp, error)
	//银行保理还款逾期
	CronBankOverDueFactoringRepay(context.Context, *OperateIntReq) (*OperateIntResp, error)
	//医疗机构被动支付置为失败
	CronBankPaymentOverDue(context.Context, *OperateIntReq) (*OperateIntResp, error)
	//银行专户交易记录同步
	CronBankTransferRecord(context.Context, *OperateStrDateReq) (*OperateIntResp, error)
	//市订单同步
	SyncShipmentPlanInfo(context.Context, *CreateSyncShipmentPlanReq) (*CreateTpSyncInfoResp, error)
	//市招采获取合同信息
	CronCityGetContract(context.Context, *CreateCityTpSyncContractMiInfoReq) (*CreateTpSyncInfoResp, error)
	//市招采获取配送计划信息
	CronCityGetPlan(context.Context, *CreateCityTpSyncShipmentPlanReq) (*CreateTpSyncInfoResp, error)
	//省续签合同同步
	SyncPContactRenew(context.Context, *CreateSyncPContactRenewReq) (*CreateTpSyncInfoResp, error)
	//市续签合同同步
	SyncCContactRenew(context.Context, *CreateSyncCContactRenewReq) (*CreateTpSyncInfoResp, error)
	//采购计划表数据处理
	CronReportShipmentPlanYear(context.Context, *CreateReportReq) (*CreateReportResp, error)
	CronReportShipmentPlanMonth(context.Context, *CreateReportReq) (*CreateReportResp, error)
	CronReportShipmentPlanDay(context.Context, *CreateReportReq) (*CreateReportResp, error)
	//合同计划表数据处理
	CronReportContractPlanYear(context.Context, *CreateReportReq) (*CreateReportResp, error)
	CronReportContractPlanMonth(context.Context, *CreateReportReq) (*CreateReportResp, error)
	CronReportContractPlanDay(context.Context, *CreateReportReq) (*CreateReportResp, error)
	//招采单流单
	CronShipmentPlanOutTimeMsg(context.Context, *CreateMessageReq) (*CreateMessageResp, error)
	//招采单流单警告消息发送
	CronSendShipmentPlanWarningMsg(context.Context, *CreateMessageReq) (*CreateMessageResp, error)
	//配送逾期消息告知
	CronShipmentOrderOverdueMsg(context.Context, *CreateMessageReq) (*CreateMessageResp, error)
	//配送逾期预警
	CronShipmentOrderSendingDeadlineMsg(context.Context, *CreateMessageReq) (*CreateMessageResp, error)
	//配送收货预警消息发送
	CronShipmentReceiveWarningMsg(context.Context, *CreateMessageReq) (*CreateMessageResp, error)
	//保理单数据
	CronReportFactoringOrderYear(context.Context, *CreateReportReq) (*CreateReportResp, error)
	CronReportFactoringOrderMonth(context.Context, *CreateReportReq) (*CreateReportResp, error)
	CronReportFactoringOrderDay(context.Context, *CreateReportReq) (*CreateReportResp, error)
	//配送单数据
	CronReportShipmentOrderYear(context.Context, *CreateReportReq) (*CreateReportResp, error)
	CronReportShipmentOrderMonth(context.Context, *CreateReportReq) (*CreateReportResp, error)
	CronReportShipmentOrderDay(context.Context, *CreateReportReq) (*CreateReportResp, error)
	//医疗机构支付按日提醒定时任务
	CronRemindMiPayMsg(context.Context, *CreateMessageReq) (*CreateMessageResp, error)
	//redis quota 清零
	CronResetRedisQuotaToZero(context.Context, *OperateIntReq) (*OperateIntResp, error)
	//生成mib中合同数据分析
	CronReportTenderContract(context.Context, *CreateReportReq) (*CreateReportResp, error)
}

